    "2016-03-17T20:52:17.375652",nt"name": "solid-waste-alternatives-program-swap-project-database",nt"isopen":
    false,nt"url": null,nt"notes": "The Solid Waste Alternatives Program (SWAP)
    is a financial assistance program with a primary objective of assisting in the reduction
    of the amount of solid waste generated and the amount of solid waste landfilled
    in the state of Iowa. To this end, SWAP provides financial support for the development
    and implementation of Best Practices, Education and Market Development projects
    that focus on waste reduction and landfill diversion.  The database allows for project
    searches by city name, county name, contract number, organization name (i.e. contractor
    name), funding round, and project keyword search.",nt"license_title": "License
